import React from 'react';
import { useParams } from 'react-router-dom';
import { Link } from 'react-router-dom';
import './Component.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const ViewAdminComponent = () => {
    const { id } = useParams();

    return (
        <div className="container mt-5">
            <div className="row justify-content-center">
                <div className="col-md-8">
                    <div className="card shadow-lg p-4 rounded">
                        <h3 className="text-center mb-4" style={{ color: '#17a2b8' }}>Admin Dashboard</h3>
                        <ul className="nav nav-pills nav-fill mb-4">
                            <li className="nav-item">
                                <Link className="nav-link btn btn-outline-primary" to={`/view-employee-personal/${id}`}>
                                    Personal
                                </Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link btn btn-outline-primary" to={`/view-employee-professional/${id}`}>
                                    Professional
                                </Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link btn btn-outline-primary" to={`/view-admin-finance/${id}`}>
                                    Finance
                                </Link>
                            </li>
                        </ul>
                        <div className="text-center">
                            <p>Select any category to view employee information.</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default ViewAdminComponent;
